import { Box, SxProps, Theme, Button } from "@mui/material";

export const Main = () => {
    return (
        <Box className="HeMainader" sx={sx}>
            <Button variant="contained" onClick={() => {
                // クリック時の処理をここに記述
                <audio id="btn_audio">
                    <source src="./audio/btn_audio.mp3" type="resources/piano/maou_se_inst_piano1_1do"></source>
                </audio>
            }} >
                ボタンに表示するテキスト
            </Button>
        </Box>
    );
};

const sx: SxProps<Theme> = {
    "&.Main": {
        width: "100%",
    },
};
